    [],nt"revision_timestamp": "2016-08-04T08:18:48.619763",nt"name": "kanuti-national-wildlife-refuge-annual-narrative-report-calendar-year-1996",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Kanuti
    NWR outlines Refuge accomplishments during the 1996 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses the master plan,
    management planning, public participation, compliance with environmental and cultural
    resource mandates, and research and investigations. Refuge administration is outlined;
    information about personnel, volunteer programs, funding, safety, and technical
    assistance is given. Habitat management is also covered; subjects include wetlands,
    forests, fire management, water rights, and wilderness areas. The wildlife section
    of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources,
    and marking and bird banding. The public uses of the Refuge described in this report
    include outdoor classrooms, interpretive programs, hunting, fishing, trapping, outdoor
    recreation, and law enforcement. The equipment and facilities section of the report
    provides information about new construction, rehabilitation, major maintenance,
    equipment replacement, communication systems, computer systems, and energy conservation.
    Cooperative programs, economic uses of the Refuge, and items of interest are provided
    at the end.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
